import { useEffect } from "react";
import Main from "./components/Main/Main";

function App() {
  useEffect(() => {
    fetch("/api")
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        console.log(data);
      })
      .catch((err) => {
        console.log(err.message);
      });
  }, []);

  return <Main />;
}

export default App;
